import React,{useStare} from "react";


function Maxshow({show,setShow}){
if(Object.keys(show).length<1) {
    console.log("Пустой обьект")
    return (<div></div>)
}
else {
    console.log("сработал блок else")
    return(
<div className="maxShow">
    <p className="closeTag" onClick={()=>setShow({})}>X</p>
  <ul>
    <li>{show.marka} </li>
    <li> {show.marka}</li>
    <li> {show.marka}</li>
  </ul>
</div>
    )
}
}
export default Maxshow
